import { SettingDecoratorConverter } from "src/app/_base/decorators/setting.decorator";

interface DataSetsStoreRecordFormat {
    id : string;
    name : string;
    datasets : string[];
}

type DataSetsStoreType = DataSetsStoreRecordFormat[] | undefined;

interface EnviromentSelectNgModelRecordFormat {
    id : string;
    name : string;
}

export class EnviromentSelectSettingDecoratorConverter 
    implements SettingDecoratorConverter<EnviromentSelectNgModelRecordFormat[], any> 
{
    storeConversion(content : any[]) : EnviromentSelectNgModelRecordFormat[] {
        // if (content === undefined) {
        //     return undefined;
        // }
        let result : EnviromentSelectNgModelRecordFormat[] = []; 
        for (let i=0; i<content.length; i++) {
            result[i]['id'] = content[i]['id'];
            result[i]['name'] = content[i]['name'];
        }
        return result;
    }

    modelConversion(content : EnviromentSelectNgModelRecordFormat[]) : any[] | undefined {
        return undefined;
    }
}
